import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const WCUTower = () => {
  return (
    
    <Container fluid className="py-5 px-4 bg-light">
         <div
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1497366811353-6870744d04b2?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80",
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundAttachment: "fixed",
        backgroundRepeat: "no-repeat",
        position: "absolute",
        top: 0,
        bottom: 0,
        left: 0,
        right: 0,
        zIndex: 1,
      }}
    >
      {/* Overlay Layer */}
      <div
        style={{
          backgroundColor: "rgba(0, 0, 0, 0.5)",
          width: "100%",
          height: "100%",
        }}
      />
    </div>
      <Row className="align-items-center">
        <Col md={6} className="p-0">
          <img
            src="https://churchgate.com/wp-content/uploads/2022/12/New-Project-1-10-766x1024.jpg"
            alt="Churchgate Building"
            className="img-fluid w-100"
            style={{ height: '100%', objectFit: 'cover' }}
          />
        </Col>
        <Col md={6} className="px-5">
          <h1 className="fw-bold text-white mb-4">Maximizing Nigeria’s Real Estate Growth Opportunities</h1>
          <p className="fs-5 text-dark">
            Situated in the heart of Abuja’s business hub, Churchgate Plaza is
            distinguished by its strategic positioning within a well-serviced
            business district. 
          </p>
        </Col>
        
      </Row>
    </Container>
  );
};

export default WCUTower;
